import React, { useEffect, useState } from "react";
import { auth, database } from "./firebase";
import { ref, onValue } from "firebase/database";
import { signOut } from "firebase/auth";
import AboutPage from "./AboutPage";
import ContactPage from "./ContactPage";
import UserProfile from "./UserProfile";
import "./Movies.css";

const moviesList = [
    { id: 1, title: "Inception", language: "English", image: "data:image/jpeg;base64," },
    { id: 6, title: "Snehitudu", language: "Telugu", image: "data:image/jpeg;base64," },
    { id: 7, title: "Magadheera", language: "Telugu", image: "data:image/jpeg;base64," },
    { id: 8, title: "Athadu", language: "Telugu", image: "data:image/jpeg;base64," },
    { id: 9, title: "RadheShayam", language: "Telugu", image: "data:image/jpeg;base64," },
    { id: 10, title: "Maari", language: "Tamil", image: "data:image/jpeg;base64," },
    { id: 11, title: "Three", language: "Tamil", image: "data:image/jpeg;base64," },
    { id: 12, title: "Vaathi", language: "Tamil", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQkLAEEtk0e2WPdURgTFMSQXEkI3ngLg0YBJg&s" },
    { id: 13, title: "Thiruchitrambalam", language: "Tamil", image: "data:image/jpeg;base64," },
    { id: 14, title: "Rayan", language: "Tamil", image: "data:image/jpeg;base64," },
    { id: 15, title: "Goblin", language: "Korean", image: "data:image/jpeg;base64," },
    { id: 16, title: "Twinklin Watermelom", language: "Korean", image: "data:image/jpeg;base64," },
    { id: 17, title: "Mulan", language: "Chinese", image: "data:image/jpeg;base64," },
    { id: 18, title: "Hiddeen love", language: "Chinese", image: "data:image/jpeg;base64," },

    { id: 19, title: "The monkey king", language: "Chinese", image: "data:image/jpeg;base64," },
    { id: 20, title: "France", language: "French", image: "data:image/jpeg;base64," },
    { id: 21, title: "Amlie", language: "French", image: "data:image/jpeg;base64," },
    { id: 22, title: "Crouching Tiger, Hidden Dragon", language: "Chinese", image: "https://image.tmdb.org/t/p/w500/5KCVkau1HEl7ZzfPsKAPM0sMiKc.jpg" },
    { id: 23, title: "Alladdin", language: "Spanish", image: "data:image/jpeg;base64," },
    { id: 24, title: "Pan's Labyrinth", language: "Spanish", image: "data:image/jpeg;base64," },
    { id: 25, title: "Cindrella", language: "English", image: "data:image/jpeg;base64," },
    { id: 26, title: "3 idiots", language: "Hindi", image: "data:image/jpeg;base64," },
];




function MoviesWebsite({ onLoginClick, onAdminLoginClick, onSignupClick, user, onLogout, onAboutClick, onUserChatOpen }) {
    const [language, setLanguage] = useState("English");
    const [movies, setMovies] = useState([]);
    const [featuredMovie, setFeaturedMovie] = useState(null);
    const [userProfile, setUserProfile] = useState({});
    const [showContactPage, setShowContactPage] = useState(false);
    const [showUserProfile, setShowUserProfile] = useState(false);

    const languages = [...new Set(moviesList.map(movie => movie.language))];

    useEffect(() => {
        if (user) {
            const userRef = ref(database, 'users/' + user.uid);
            onValue(userRef, (snapshot) => {
                const data = snapshot.val();
                if (data) {
                    setUserProfile(data);
                    if (data.language) {
                        setLanguage(data.language);
                        const filteredMovies = moviesList.filter(movie => movie.language === data.language);
                        setMovies(filteredMovies);
                        setFeaturedMovie(filteredMovies[0]);
                    } else {
                        setMovies(moviesList.filter(movie => movie.language === "English"));
                        setFeaturedMovie(moviesList[0]);
                    }
                }
            });
        } else {
            setMovies(moviesList.filter(movie => movie.language === "English"));
            setFeaturedMovie(moviesList[0]);
        }
    }, [user]);

    const handleLogout = async () => {
        await signOut(auth);
        onLogout();
    };

    const handleLanguageChange = () => {
        const currentIndex = languages.indexOf(language);
        const nextIndex = (currentIndex + 1) % languages.length;
        const newLanguage = languages[nextIndex];
        setLanguage(newLanguage);
        const filteredMovies = moviesList.filter(movie => movie.language === newLanguage);
        setMovies(filteredMovies);
        setFeaturedMovie(filteredMovies[0]);
    };

    const handleContactClick = () => {
        setShowContactPage(true);
    };

    const handleContactBack = () => {
        setShowContactPage(false);
    };

    const handleUserProfileOpen = () => {
        setShowUserProfile(true);
    };

    const handleUserProfileClose = () => {
        setShowUserProfile(false);
    };

    const handleUserProfileUpdate = (updatedProfile) => {
        setUserProfile(updatedProfile);
    };

    if (showContactPage) {
        return <ContactPage onBack={handleContactBack} currentUser={user} />;
    }

    if (showUserProfile) {
        return <UserProfile onClose={handleUserProfileClose} onUserProfileUpdate={handleUserProfileUpdate} />;
    }

    return (
        <div className="movies-app">
            <nav className="navbar">
                <div className="navbar-brand">MoviesApp</div>
                <div className="navbar-links">
                    <button className="nav-button" onClick={onAboutClick}>About</button>
                    <button className="nav-button" onClick={handleContactClick}>Contact</button>
                    {!user && (
                        <>
                            <button className="nav-button" onClick={onSignupClick}>Signup</button>
                            <button className="nav-button" onClick={onLoginClick}>Login</button>
                            <button className="nav-button" onClick={onAdminLoginClick}>Admin Login</button>
                        </>
                    )}
                    <button className="nav-button" onClick={handleLanguageChange}>
                        Language: {language}
                    </button>
                </div>
                {user && (
                    <div className="navbar-user">
                        <span>{user.email}</span>
                        <button onClick={handleUserProfileOpen} className="nav-button">Profile</button>
                        <button onClick={handleLogout} className="nav-button">Logout</button>
                    </div>
                )}
            </nav>

            {featuredMovie && (
                <header
                    className="hero-banner"
                    style={{ backgroundImage: `url(${featuredMovie.image})` }}
                >
                    <div className="hero-content">
                        <h1>{featuredMovie.title}</h1>
                        <p>Featured Movie</p>
                    </div>
                </header>
            )}

            <main className="movies-main">
                <section className="user-details-section">
                    <h2>User Details</h2>
                    <p><strong>Name:</strong> {userProfile.userName || "N/A"}</p>
                    <p><strong>Email:</strong> {userProfile.email || (user ? user.email : "N/A")}</p>
                    <p><strong>Contact No:</strong> {userProfile.contactNo || "N/A"}</p>
                    <p><strong>Gender:</strong> {userProfile.gender || "N/A"}</p>
                    {user && (
                        <button className="chat-button" onClick={onUserChatOpen}>
                            Open Chat
                        </button>
                    )}
                </section>

                <h2>Movies in {language}</h2>
                <div className="movies-row">
                    {movies.map(movie => (
                        <div key={movie.id} className="movie-card">
                            <img src={movie.image} alt={movie.title} />
                            <div className="movie-info">
                                <h3>{movie.title}</h3>
                                <p>{movie.language}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </main>
        </div>
    );
}

export default MoviesWebsite;
